import React from 'react'
import {Nav, NavbarContainer, NavLogo, NavMenu, NavItem, Link} from './NavbarElements'
import {animateScroll as scroll} from 'react-scroll'



const Navbar = () => {


    const toggleHome = () => {
        scroll.scrollToTop();
    }

    return (
        <>
            <Nav>
                <NavbarContainer>
                    <NavLogo to="/" onClick={toggleHome}>Connor Rosenberg</NavLogo>
                    <NavMenu>
                        <NavItem>
                            <Link to="about"
                            smooth={true}
                            duration={500}
                            spy={true}
                            exact="true">
                                About Me
                            </Link>
                        </NavItem>
                        <NavItem>
                            <Link to="projects"
                            smooth={true}
                            duration={500}
                            spy={true}
                            exact="true">
                                CS Projects
                            </Link>
                        </NavItem>
                        <NavItem>
                            <Link to="extracurriculars"
                            smooth={true}
                            duration={500}
                            spy={true}
                            exact="true">
                                Extracurriculars
                            </Link>
                        </NavItem>
                        <NavItem>
                            <Link to="contact"
                            smooth={true}
                            duration={500}
                            spy={true}
                            exact="true">
                                Contact Me
                            </Link>
                        </NavItem>
                    </NavMenu>
                </NavbarContainer>
            </Nav>
        </>
    )
}

export default Navbar
